import React, { useState } from 'react'

function ExpenseInpute() {
    const [expense,setExpense]=useState([])
    const [price,setPrice]=useState([])
    const [date,setDate]=useState([])

    console.log(expense);


  return (
    <div>
        <label htmlFor="expense">Expense</label>
        <input type="text" placeholder='Enter Expense' onChange={(e)=>setExpense(e.target.value)} name="expense" />
        <label htmlFor="price">Amount</label>
        <input type="number" name='price' onChange={(e)=>setPrice(e.target.value)} />
        <label htmlFor="date">Date</label>
        <input type="date" name="date" onChange={(e)=>setDate(new Date(e.target.value))}/>

    </div>
  )
}

export default ExpenseInpute
